    true,nt"url": null,nt"notes": "These data are Pacific Northwest National
    Lab inversions of an amalgamation of two  surface gravity datasets: Davenport-Newberry
    gravity collected prior to 2012 stimulations and Zonge International gravity collected
    for the project "Novel use of 4D Monitoring Techniques to Improve Reservoir Longevity
    and Productivity in Enhanced Geothermal Systems" in 2012. Inversions of surface
    gravity recover a 3D distribution of density contrast from which intrusive igneous
    bodies are identified. The data indicate a body name, body type, point type, UTM
    X and Y coordinates, Z data is specified as meters below sea level (negative values
    then indicate elevations above sea level), thickness of the body in meters, suscept,
    density anomaly in g/cc, background density in g/cc, and density in g/cc. nnThe
    model was created using a commercial gravity inversion software called ModelVision
    12.0 (http://www.tensor-research.com.au/Geophysical-Products/ModelVision). The initial
    model is based on the seismic tomography interpretation (Beachly et al., 2012).
    All the gravity data used to constrain this model are on the GDR:  https://gdr.openei.org/submissions/760.
